import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Tasks from "./pages/Tasks";
import Task from "./pages/Task";

function App() {
  return (
    <Router>
      <Routes>
        <Route
          children={
            <>
              <Tasks />
            </>
          }
          location="/"
        />
        <Route
          children={
            <>
              <Task />
            </>
          }
          location="/:taskId"
        />
      </Routes>
    </Router>
  );
}

export default App;
